def fasta_to_dict(dna_fasta):
    seq = [x.rstrip() for x in dna_fasta]
    dna_seqs = {seq[0][1:] : ''}
    last = ""
    for lines in seq:
        if lines[0] == '>':
            last = lines[1:]
            dna_seqs.setdefault(last, '')
        else:
            dna_seqs[last] += lines
    print(dna_seqs)
    return dna_seqs

def dna_to_consensus(dna):
    length = len(dna[0])
    consensus = ""
    profile = {'A' : [0 for i in range(length)],
        'C': [0 for i in range(length)],
        'G': [0 for i in range(length)],
        'T': [0 for i in range(length)]}
    for seqs in dna:
        for i in range(len(seqs)):
            profile[seqs[i]][i]+=1
    for i in range(length):
        max = 0
        maxkey = ''
        for key, values in profile.items():
            if values[i] > max:
                max = values[i]
                maxkey = key 
        consensus += maxkey
    print(consensus)
    print('A',':', ' '.join(str(x) for x in profile['A']))
    print('C',':', ' '.join(str(x) for x in profile['C']))
    print('G',':', ' '.join(str(x) for x in profile['G']))
    print('T',':', ' '.join(str(x) for x in profile['T']))

with open('example.txt') as f:
    content =f.readlines()
    dnas = list(fasta_to_dict(content).values())
    dna_to_consensus(dnas)

with open('rosalind_cons.txt') as f:
    content =f.readlines()
    dnas = list(fasta_to_dict(content).values())
    dna_to_consensus(dnas)


